        <style>
            #slider-container {
                position: fixed;
                top: 10px;
                left: 50%;
                transform: translateX(-50%);
                z-index: 1000;
                background: white;
                padding: 15px;
                border-radius: 10px;
                box-shadow: 0 4px 15px rgba(0,0,0,0.3);
                width: 80%;
                max-width: 500px;
                border: 2px solid #007bff;
            }
            .ui-slider .ui-slider-handle {
                width: 24px;
                height: 24px;
                border-radius: 50%;
                background: #007bff;
                border: 3px solid white;
                box-shadow: 0 2px 5px rgba(0,0,0,0.5);
            }
            .ui-slider .ui-slider-range {
                background: #007bff;
            }
            #info-display {
                display: flex;
                justify-content: space-between;
                margin-top: 10px;
                font-weight: bold;
                font-size: 14px;
            }
            .hora-activa {
                color: #007bff;
                font-weight: bold;
            }
        </style>
    </head>
    <body>
        <div id="slider-container">
            <div style="text-align: center; margin-bottom: 10px;">
                <strong style="font-size: 16px; color: #007bff;">üïê Control de Horas - Heatmaps</strong>
            </div>

            <div id="slider"></div>

            <div id="info-display">
                <span id="hora-display" class="hora-activa">Hora: 12:00</span>
                <span id="ubicaciones-display">Ubicaciones: 0</span>
                <span id="clientes-display">Clientes: 0</span>
            </div>

            <div style="margin-top: 8px; font-size: 12px; text-align: center;">
                <em>Usa tambi√©n el control de capas ‚ÜóÔ∏è para mostrar/ocultar horas</em>
            </div>
        </div>

        <script>
        // Datos por hora
        var clientesData = {"0": 4545.0, "1": 2668.0, "2": 2575.0, "3": 3246.0, "4": 4036.0, "5": 7706.0, "6": 8678.0, "7": 8691.0, "8": 8692.0, "9": 8705.0, "10": 8701.0, "11": 8652.0, "12": 8553.0, "13": 8550.0, "14": 8406.0, "15": 8218.0, "16": 7699.0, "17": 6608.0, "18": 5087.0, "19": 3460.0, "20": 2892.0, "21": 4630.0, "22": 3603.0, "23": 3531.0};
        var ubicacionesData = {"0": 560, "1": 417, "2": 429, "3": 518, "4": 644, "5": 842, "6": 871, "7": 871, "8": 871, "9": 871, "10": 871, "11": 870, "12": 868, "13": 869, "14": 864, "15": 859, "16": 846, "17": 806, "18": 717, "19": 534, "20": 506, "21": 577, "22": 498, "23": 505};

        $(document).ready(function() {
            // Inicializar slider
            $("#slider").slider({
                min: 0,
                max: 23,
                value: 12,
                step: 1,
                slide: function(event, ui) {
                    updateDisplay(ui.value);
                },
                change: function(event, ui) {
                    switchToHour(ui.value);
                }
            });

            // Inicializar con hora 12
            switchToHour(12);
        });

        function switchToHour(hora) {
            // Ocultar todas las capas de horas
            for (var i = 0; i <= 23; i++) {
                var layerName = "Hora " + i.toString().padStart(2, '0') + ":00";
                var layer = map.layerManager.getLayer('feature_group', layerName);
                if (layer) {
                    map.removeLayer(layer);
                }
            }

            // Mostrar la capa de la hora seleccionada
            var selectedLayerName = "Hora " + hora.toString().padStart(2, '0') + ":00";
            var selectedLayer = map.layerManager.getLayer('feature_group', selectedLayerName);
            if (selectedLayer) {
                map.addLayer(selectedLayer);
            }

            updateDisplay(hora);
        }

        function updateDisplay(hora) {
            $("#hora-display").html("<span class='hora-activa'>Hora: " + hora.toString().padStart(2, '0') + ":00</span>");
            $("#ubicaciones-display").text("Ubicaciones: " + (ubicacionesData[hora] || 0));
            $("#clientes-display").text("Clientes: " + (clientesData[hora] || 0));
        }
        </script>
